import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './styles/index.css';
import Home from './components/Home.jsx';
import Login from './components/Login';
import Signup from './components/Signup';
import Dashboard from './components/Dashboard';
import Admission from './components/Admission';
import AdmissionCheck from './components/AdmissionCheck';
import AdmissionApproval from "./components/AdmissionApproval"
import AdmissionRejection from './components/AdmissionRejection';
import AntdTable1 from './components/Table1.jsx';
import { Space, Table, Tag } from 'antd';

export default function App() {
  const loggedIn = window.localStorage.getItem("isLoggedIn")


// import React from 'react';

      const columns = [
        {
          title: 'Name',
          dataIndex: 'name',
          key: 'name',
          render: (text) => <a>{text}</a>,
        },
        {
          title: 'Age',
          dataIndex: 'age',
          key: 'age',
        },
        {
          title: 'Address',
          dataIndex: 'address',
          key: 'address',
        },
        {
          title: 'Tags',
          key: 'tags',
          dataIndex: 'tags',
          render: (_, { tags }) => (
            <>
              {tags.map((tag) => {
                let color = tag.length > 5 ? 'geekblue' : 'green';
                if (tag === 'loser') {
                  color = 'volcano';
                }
                return (
                  <Tag color={color} key={tag}>
                    {tag.toUpperCase()}
                  </Tag>
                );
              })}
            </>
          ),
        },
        {
          title: 'Action',
          key: 'action',
          render: (_, record) => (
            <Space size="middle">
              <a>Invite {record.name}</a>
              <a>Delete</a>
            </Space>
          ),
        },
      ];
      const data = [
        {
          key: '1',
          name: 'John Brown',
          age: 32,
          address: 'New York No. 1 Lake Park',
          tags: ['nice', 'developer'],
        },
        {
          key: '2',
          name: 'Jim Green',
          age: 42,
          address: 'London No. 1 Lake Park',
          tags: ['loser'],
        },
        {
          key: '3',
          name: 'Joe Black',
          age: 32,
          address: 'Sydney No. 1 Lake Park',
          tags: ['cool', 'teacher'],
        },
      ];
      const App = () => <Table columns={columns} dataSource={data} />;

      return (
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home />}></Route>
            <Route path="/Login" element={loggedIn? <Dashboard/>:<Login />}></Route>
            <Route path="/Signup" element={loggedIn? <Dashboard/>:<Signup />}></Route>
            <Route path="/Dashboard" element={<Dashboard />}></Route>
            <Route path="/Admission" element={loggedIn? <Admission/>:<Login />}></Route>
            <Route path="/AdmissionCheck" element={loggedIn? <AdmissionCheck/>:<Login />}></Route>
            <Route path="/AdmissionApproval" element={<AdmissionApproval/>}></Route>
            <Route path="/AdmissionRejection" element={<AdmissionRejection/>}></Route>

            <Route path="/Table" element={<AntdTable1/>}></Route>

          </Routes>
        </BrowserRouter>)
  };



  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(<App />);
